044e\u0447\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%85%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0411\u0430\u043a\u0438\u043d\u0441\u043a\u043e\u0435 \u0445\u0430\u043d\u0441\u0442\u0432\u043e\">\u0411\u0430\u043a\u0438\u043d\u0441\u043a\u043e\u0435 \u0445\u0430\u043d\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0441\u0441\u044b\u043b\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%95%D0%BB%D0%B5%D0%BD%D1%8B\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b\">\u043e\u0441\u0442\u0440\u043e\u0432\u0435 \u0421\u0432. \u0415\u043b\u0435\u043d\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BB%D0%B0%D0%BD%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0410\u0442\u043b\u0430\u043d\u0442\u0438\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863_%D0%B3%D0%BE%D0%B4\" title=\"1863 \u0433\u043e\u0434\">1863<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A1%D0%A8%D0%90\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410<\/a>: \u0412 \u0445\u043e\u0434\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u0439 \u0437\u0430\u0442\u043e\u043d\u0443\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0\" title=\"\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430\">\u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/H._L._Hunley\" title=\"H. L. Hunley\"><i>Hunley<\/i><\/a>, \u043f\u0440\u0438 \u044d\u0442\u043e\u043c \u043f\u043e\u0433\u0438\u0431 \u0435\u0451 \u0441\u043e\u0437\u0434\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%BD%D0%BB%D0%B8,_%D0%A5%D0%BE%D1%80%D0%B0%D1%81_%D0%9B%D0%BE%D1%83%D1%81%D0%BE%D0%BD\" title=\"\u0425\u0430\u043d\u043b\u0438, \u0425\u043e\u0440\u0430\u0441 \u041b\u043e\u0443\u0441\u043e\u043d\">\u0413\u043e\u0440\u0430\u0446\u0438\u0439 \u041b\u043e\u0443\u0441\u043e\u043d \u0425\u0430\u043d\u043b\u0438<\/a> \u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \u0438\u0437 \u0441\u0435\u043c\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864_%D0%B3%D0%BE%D0%B4\" title=\"1864 \u0433\u043e\u0434\">1864<\/a>&#160;\u2014 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%93%D0%BB%D0%B0%D0%B7%D0%B3%D0%BE\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0413\u043b\u0430\u0437\u0433\u043e\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0413\u043b\u0430\u0437\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1880_%D0%B3%D0%BE%D0%B4\" title=\"1880 \u0433\u043e\u0434\">1880<\/a>&#160;\u2014 \u0441\u043f\u0443\u0441\u0442\u044f 632 \u0433\u043e\u0434\u0430 \u043f\u043e\u0441\u043b\u0435 \u0437\u0430\u043a\u043b\u0430\u0434\u043a\u0438 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043a\u0430\u043c\u043d\u044f, \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%91%D0%BB%D1%8C%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" title=\"\u041a\u0451\u043b\u044c\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u041a\u0451\u043b\u044c\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1883_%D0%B3%D0%BE%D0%B4\" title=\"1883 \u0433\u043e\u0434\">1883<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB%D0%B0_%D0%A7%D0%B5%D1%85%D0%BE%D0%B2%D0%B0\" title=\"\u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0438\u043c\u0435\u043d\u0438 \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0427\u0435\u0445\u043e\u0432\u0430\">\u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0434\u0440\u0430\u043c\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%BE%D0%B3%D0%B4%D0%B0\" title=\"\u0412\u043e\u043b\u043e\u0433\u0434\u0430\">\u0412\u043e\u043b\u043e\u0433\u0434\u0435<\/a> \u0431\u044b\u043b \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%BE%D0%B3%D0%BE%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D0%BB%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4\" title=\"\u0412\u043e\u043b\u043e\u0433\u043e\u0434\u0441\u043a\u0438\u0439 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u043b\u043e\u043c\u0431\u0430\u0440\u0434\">\u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u043b\u043e\u043c\u0431\u0430\u0440\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1894_%D0%B3%D0%BE%D0%B4\" title=\"1894 \u0433\u043e\u0434\">1894<\/a>&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043e\u0444\u0438\u0446\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%80%D0%B5%D0%B9%D1%84%D1%83%D1%81,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4\" title=\"\u0414\u0440\u0435\u0439\u0444\u0443\u0441, \u0410\u043b\u044c\u0444\u0440\u0435\u0434\">\u0410\u043b\u044c\u0444\u0440\u0435\u0434 \u0414\u0440\u0435\u0439\u0444\u0443\u0441<\/a> (<span lang=\"fr\" style=\"font-style: italic\" xml:lang=\"fr\">Alfred Dreyfus<\/span>) \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D0%B6\" title=\"\u0428\u043f\u0438\u043e\u043d\u0430\u0436\">\u0448\u043f\u0438\u043e\u043d\u0430\u0436\u0435<\/a>&#160;\u2014 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BB%D0%BE_%D0%94%D1%80%D0%B5%D0%B9%D1%84%D1%83%D1%81%D0%B0\" title=\"\u0414\u0435\u043b\u043e \u0414\u0440\u0435\u0439\u0444\u0443\u0441\u0430\">\u0434\u0435\u043b\u043e \u0414\u0440\u0435\u0439\u0444\u0443\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a>&#160;\u2014 \u0432 \u0410\u043d\u0433\u043b\u0438\u0438 \u043f\u043e\u0445\u0438\u0449\u0435\u043d \u0438 \u043f\u0435\u0440\u0435\u043f\u043b\u0430\u0432\u043b\u0435\u043d \u043d\u0430 \u043c\u043e\u043d\u0435\u0442\u044b \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u0443\u0431\u043e\u043a \u0441\u0442\u0440\u0430\u043d\u044b.<\/li><\/ul><h3><span class=\"mw-headline\" id=\"XX_.D0.B2.D0.B5.D0.BA\">XX \u0432\u0435\u043a<\/span> <\/span><\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%A2%D0%B8%D1%85%D0%BE%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%8D%D1%81%D0%BA%D0%B0%D0%B4%D1%80%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0430\u044f \u044d\u0441\u043a\u0430\u0434\u0440\u0430\">\u0412\u0442\u043e\u0440\u0430\u044f \u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0430\u044f \u044d\u0441\u043a\u0430\u0434\u0440\u0430<\/a> \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BB%D0%BB%D0%B8%D0%BD\" title=\"\u0422\u0430\u043b\u043b\u0438\u043d\">\u0420\u0435\u0432\u0435\u043b\u044f<\/a> \u0438 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B9%D1%88%D1%83%D0%BD%D1%8C\" class=\"mw-redirect\" title=\"\u041b\u044e\u0439\u0448\u0443\u043d\u044c\">\u041f\u043e\u0440\u0442-\u0410\u0440\u0442\u0443\u0440<\/a>. \u042d\u0441\u043a\u0430\u0434\u0440\u0430 \u0431\u0443\u0434\u0435\u0442 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%83%D1%81%D0%B8%D0%BC%D0%B0\" title=\"\u0426\u0443\u0441\u0438\u043c\u0430\">\u0426\u0443\u0441\u0438\u043c\u0441\u043a\u043e\u043c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905 \u0433\u043e\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u00ab\u0434\u0430\u043b\u044c\u043d\u0438\u0439\u00bb \u043f\u0435\u0440\u0435\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B0%D1%8D%D1%80%D0%BE%D0%B4%D1%80%D0%BE%D0%BC_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%9C._%D0%92._%D0%A4%D1%80%D1%83%D0%BD%D0%B7%D0%B5\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0430\u044d\u0440\u043e\u0434\u0440\u043e\u043c \u0438\u043c\u0435\u043d\u0438 \u041c. \u0412. \u0424\u0440\u0443\u043d\u0437\u0435\">\u0425\u043e\u0434\u044b\u043d\u0441\u043a\u043e\u0435 \u043f\u043e\u043b\u0435<\/a>&#160;\u2014 \u0434\u0435\u0440\u0435\u0432\u043d\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D1%91%D0%BC%D1%83%D1%88%D0%BA%D0%B8_(%D1%80%D0%B0%D0%B9%D0%BE%D0%BD_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D1%8B)\" title=\"\u0427\u0435\u0440\u0451\u043c\u0443\u0448\u043a\u0438 (\u0440\u0430\u0439\u043e\u043d \u041c\u043e\u0441\u043a\u0432\u044b)\">\u0427\u0435\u0440\u0451\u043c\u0443\u0448\u043a\u0438<\/a> (\u043e\u043a\u043e\u043b\u043e 15 \u043a\u043c), <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D1%84%D0%B8%D0%BC%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9D%D0%B8%D0%BA%D0%B8%D1%84%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0415\u0444\u0438\u043c\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u043e\u0432\u0438\u0447\">\u041c.&#160;\u041d.&#160;\u0415\u0444\u0438\u043c\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%BE%D0%BE%D0%BF%D0%B0%D1%80%D0%BA\" title=\"\u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u0437\u043e\u043e\u043f\u0430\u0440\u043a\">\u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u0437\u043e\u043e\u043f\u0430\u0440\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D1%81%D0%B5%D0%BD\" title=\"\u0412\u0435\u043d\u0441\u0435\u043d\">\u0412\u0435\u043d\u0441\u0435\u043d\u0435<\/a>, \u0432 \u043e\u043a\u0440\u0435\u0441\u0442\u043d\u043e\u0441\u0442\u044f\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0430<\/a>, \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d\u0430 \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0442\u0430\u043d\u0446\u043e\u0432\u0449\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%82%D0%B0_%D0%A5%D0%B0%D1%80%D0%B8\" title=\"\u041c\u0430\u0442\u0430 \u0425\u0430\u0440\u0438\">\u041c\u0430\u0442\u0430 \u0425\u0430\u0440\u0438<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Mata Hari<\/span>) \u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D0%B6\" title=\"\u0428\u043f\u0438\u043e\u043d\u0430\u0436\">\u0448\u043f\u0438\u043e\u043d\u0430\u0436<\/a> \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043d\u0430 \u0431\u0430\u0437\u0435 \u0431\u044b\u0432\u0448\u0435\u0439 \u0428\u0435\u0440\u0435\u043c\u0435\u0442\u0435\u0432\u0441\u043a\u043e\u0439 \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u044b \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u0430 \u043d\u0435\u043e\u0442\u043b\u043e\u0436\u043d\u043e\u0439 \u043f\u043e\u043c\u043e\u0449\u0438. \u0412 \u0434\u0435\u043d\u044c \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u0438\u044f \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0437\u0434\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/23_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"23 \u0438\u044e\u043b\u044f\">23 \u0438\u044e\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923 \u0433\u043e\u0434\u0430<\/a> \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0430 \u0432 <a href=\"https:\/\